Сургут.description:
ООО «Вторчермет» включает в себя более 5 объектов на территории ХМАО, предлагает дорого сдать металлолом по высокой цене с самовывозом от клиента.
Работает со всеми типами металлических отходов, бывших конструкций, различных частей изделий, негодных инструментов и оснастки. Толщина изделий может быть любой, но от нее будет зависеть конечная стоимость. Поэтому если вы не знаете, куда или где сдать металлолом, то обращайтесь к нам по телефону или оставляйте заявку.
Основные услуги компании:
• прием лома черных и цветных металлов;
• утилизация автотранспортных средств;
• самовывоз;
• переработка и продажа металлолома;
• заключение договоров по продаже и покупке оптовых партий лома.

